class Solution {
  String shortestBeautifulSubstring(String s, int k) {
    int n = s.length;
    List<int> prefixSum = List.filled(n + 1, 0);
    for (int i = 0; i < n; i++) {
      prefixSum[i + 1] = prefixSum[i] + (s[i] == '1' ? 1 : 0);
    }
    int minLength = n + 1;
    String result = "";
    for (int i = 0; i < n; i++) {
      for (int j = i + 1; j <= n; j++) {
        if (prefixSum[j] - prefixSum[i] == k) {
          int length = j - i;
          if (length < minLength) {
            minLength = length;
            result = s.substring(i, j);
          } else if (length == minLength) {
            String currentSubstring = s.substring(i, j);
            if (currentSubstring.compareTo(result) < 0) {
              result = currentSubstring;
            }
          }
        }
      }
    }
    return result;
  }
}
